import './index.css'; 
import Logobar from './features/Logobar';
import Navbar from './features/Navbar';
import Body from './features/Body';
import { useEffect, useState } from 'react';



function App() {


  //Render once to set userId
  useEffect(() => {
    localStorage.setItem("selectionSoftwareProductDocumentId", "187");
  }, []); 

  //Shared for average score, 
  const [avgScore, setAvgScore] = useState(0);
  //State for count ✅, ❌, and ❓
  const [tick, setTick] = useState(0);
  const [cross, setCross] = useState(0);
  const [question, setQuestion] = useState(0);
  //State for createdDate
  const [date, setDate] = useState('');
  //State for click -> disable after one click permanently
  const [hasClicked, setHasClicked] = useState(false);


  return (
    <>
    <div> <Logobar /> </div>
    <div> <Navbar setAvgScore={setAvgScore} setTick={setTick} setCross={setCross} setQuestion={setQuestion} setDate={setDate} date={date} setHasClicked={setHasClicked} hasClicked={hasClicked}/> </div>
    <div> <Body avgScore={avgScore} tick={tick} cross={cross} question={question} /> </div>
    </>
  )
}

export default App;
